import React, { Component, Fragment } from 'react';
import Mynav from '../component/route/MyNav';

class Login extends Component{

    Loginn = () => {
        sessionStorage.setItem('userName', 'Ismail Saheb')
    }
    render (){
        return (
            <Fragment>
                <div>
                   <Mynav/>
                   <button onClick={this.Loginn}>Log In</button>
                </div>
            </Fragment>
        )
    }
}
export default Login;
